import React from 'react';

const PriceLoad = (props) =>{
	const pounds = Array.from(props.price);
	const pence = pounds.splice(-2);
	const priceSplit = () =>{
		console.log(props.price);
		console.log(pounds);
		console.log(pence);
		return(
			<p className="price">pounds.join . <span>pence.join</span></p>
		)
	};
	return(
		<div className="col-6 mb-cons">
			{priceSplit}
		</div>
	)
};
export default PriceLoad;
